import csv

def csv_to_txt():
    filename, line_break = 'world-cities_csv.csv', 0

    with open(filename, 'r') as csvfile:
        datareader = csv.reader(csvfile)
        for row in datareader:
            for word in row[0].split(" "):
                print('"' + word.lower() + '"', end =",")
                line_break += 1
            if line_break > 20:
                print()
                line_break = 0

